(function() {
    // 获取 tags 数据
    let tags = data.last_tags;
    let htmlArr = '';

    // 先判断是否为 null 或空值
    if (tags === null || tags === undefined || tags === '') {
        return htmlArr; // 直接返回空字符串
    }

    // 处理可能的 JSON 字符串（如果 data.tags 是字符串形式的 JSON）
    if (typeof tags === 'string') {
        try {
            tags = JSON.parse(tags);
        } catch (e) {
            // 解析失败则视为无效数据
            return htmlArr;
        }
    }

    // 确保 tags 是数组且有数据
    if (Array.isArray(tags) && tags.length > 0) {
        // 遍历数组生成每个标签
        const tagElements = tags.map((tag, index) => {
            // 取出标签名称（srfmajortext 字段）
            const tagName = tag.srfmajortext || '';
            
            // 动态设置边距
            const marginRight ='15px';
            const marginTop = '5px';
            
            // 蓝色微圆外框线样式
            return `<span style="
                color: #1890ff; 
                display: inline-block; 
                margin-right: ${marginRight};
                margin-top: ${marginTop};
                border: 1px solid #1890ff; /* 蓝色边框 */
                border-radius: 4px; /* 微圆效果 */
                padding: 3px 8px; /* 内部留白，避免文字贴边框 */
                font-size: 13px;
            ">${tagName}</span>`;
        });

        // 拼接所有标签
        htmlArr = tagElements.join('');
    }

    return htmlArr;
})()

(function() {
    // 尝试解析数据（处理可能的JSON字符串或直接对象）
    let talentPoolData = data.last_tp_talent_pool;
    
    // 如果是字符串，尝试解析为JSON
    if (typeof talentPoolData === 'string') {
        try {
            talentPoolData = JSON.parse(talentPoolData);
        } catch (e) {
            // 解析失败，视为普通字符串
        }
    }
    
    let htmlArr = '';
    
    // 判断是否为数组
    if (Array.isArray(talentPoolData)) {
        if (talentPoolData.length > 1) {
            // 数组长度超过1，显示"x个人才库"
            htmlArr = `<span style="color: #555B61; font-size: 14px; font-family: 'Microsoft YaHei';">归档人才库：${talentPoolData.length}个人才库</span>`;
        } else if (talentPoolData.length === 1) {
            // 数组长度为1，显示人才库名称
            const name = talentPoolData[0].name || '';
            htmlArr = `<span style="color: #555B61; font-size: 14px; font-family: 'Microsoft YaHei';">归档人才库：${name}</span>`;
        }
    } else {
        // 非数组，直接显示值（可能是单个名称或其他内容）
        htmlArr = `<span style="color: #555B61; font-size: 14px; font-family: 'Microsoft YaHei';">归档人才库：公共人才库</span>`;
    }
    
    return htmlArr;
})()

